Tarzan (tv-serie, drie afleveringen):

Tarzan, de legende uit de jungle, is terug in nieuwe opwindende avonturen. Als heerser van de jungle en vriend van de wilde dieren komt hij in actie tegen alle stropers en bandieten die niets ontziend uit zijn op winstbejag. Zelfs Jane komt in gevaar als een aantal stropers haar pad kruist. 
Gelukkig spreekt Tarzan de taal der dieren, zodat hij bij gevaar altijd een beroep op hen kan doen. En anders is er altijd nog Cheetah, de vrolijke chimpansee die heel slim goed van kwaad weet te onderscheiden.

Cast: Wolf Larson, Lydie Denier


